import { useContext } from "react";
import "../styles/Header.css";
import { targetContext } from "./AnimeMap";
function Header() {
  const { targetlist } = useContext(targetContext);
  return (
    <div className="header">
      <span>Title goes here</span>
      <span>TIMER GOES HERE</span>
      <div className="thing-tracker">
        {targetList.map((target, index) => (
          <div key={index} className="listBox">
            <img src={target.image} className="listBoxImg" alt=""></img>
            <p>{target.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Header;
